import './style.css';




function Skills(props) {

  return (


    <div className="skills-div ">

      <div className="skills">
        <h2 id="h2-skills">Minhas Skills / Autonomia</h2>
        <ul>
          <li><span className="html5"></span><em>HTML</em></li>
          <li><span className="css3"></span><em>CSS</em></li>
          <li><span className="js"></span><em>Javascript</em></li>
          <li><span className="reactjs"></span><em>React.js</em></li>
          <li><span className="nodejs"></span><em>Node.js</em></li>
          <li><span className="java"></span><em>JAVA</em></li>
          <li><span className="sql"></span><em>SQL (mySQL)</em></li>


        </ul>

      </div>
      
    </div>


  )



}


export default Skills;
